[{"location":"api/#API","page":"API Reference","title":"API","text":"","category":"section"},{"location":"api/#Modules","page":"API Reference","title":"Modules","text":"","category":"section"},{"location":"api/","page":"API Reference","title":"API Reference","text":"Order = [:module]","category":"page"},{"location":"api/#Types-and-constants","page":"API Reference","title":"Types and constants","text":"","category":"section"},{"location":"api/","page":"API Reference","title":"API Reference","text":"Order = [:type, :constant]","category":"page"},{"location":"api/#Functions-and-macros","page":"API Reference","title":"Functions and macros","text":"","category":"section"},{"location":"api/","page":"API Reference","title":"API Reference","text":"Order = [:macro, :function]","category":"page"},{"location":"api/#Documentation","page":"API Reference","title":"Documentation","text":"","category":"section"},{"location":"api/#DoubleBetaDecayGenerators.TwoNuDBDData","page":"API Reference","title":"DoubleBetaDecayGenerators.TwoNuDBDData","text":"TwoNuDBDData(path)\n\nA structure to hold numerical calculations of two-neutrino double-beta decay in the format provided by Iachello, F. and Kotila, J. [1].\n\n[1] https://nucleartheory.yale.edu/double-beta-decay-phase-space-factors\n\n\n\n\n\n","category":"type"},{"location":"api/#DoubleBetaDecayGenerators.ZeroNuDBDData","page":"API Reference","title":"DoubleBetaDecayGenerators.ZeroNuDBDData","text":"ZeroNuDBDData(path)\n\nA structure to hold numerical calculations of zero-neutrino double-beta decay in the format provided by Iachello, F. and Kotila, J. [1].\n\n[1] https://nucleartheory.yale.edu/double-beta-decay-phase-space-factors\n\n\n\n\n\n","category":"type"},{"location":"api/#DoubleBetaDecayGenerators.acute_inv_cdf-Tuple{Real, Real}","page":"API Reference","title":"DoubleBetaDecayGenerators.acute_inv_cdf","text":"acute_inv_cdf(x, q)\n\nThe inverse of the cumulative of the \"acute\" probability distribution, where q is the linear angular coefficient.\n\n[1] https://stats.stackexchange.com/questions/171592/generate-random-numbers-with-linear-distribution\n\n\n\n\n\n","category":"method"},{"location":"api/#DoubleBetaDecayGenerators.Legacy","page":"API Reference","title":"DoubleBetaDecayGenerators.Legacy","text":"Legacy code for generating events in the DECAY0 format.\n\n\n\n\n\n","category":"module"},{"location":"api/#DoubleBetaDecayGenerators.Legacy.dk0gen-Tuple{Int64}","page":"API Reference","title":"DoubleBetaDecayGenerators.Legacy.dk0gen","text":"dk0gen(N; options)\n\nGenerate N events and dump them on file in the DECAY0 format.\n\n\n\n\n\n","category":"method"},{"location":"api/#DoubleBetaDecayGenerators.Legacy.momentum-Tuple{Any}","page":"API Reference","title":"DoubleBetaDecayGenerators.Legacy.momentum","text":"Convert energy to momentum (relativistic)\n\n\n\n\n\n","category":"method"},{"location":"api/#DoubleBetaDecayGenerators.Legacy.rand_2nbb-Tuple{TwoNuDBDData}","page":"API Reference","title":"DoubleBetaDecayGenerators.Legacy.rand_2nbb","text":"rand_2nbb(data::TwoNuDBDData)\n\nGenerate the momenta of the two electrons emitted in two-neutrino double-beta decay, according to numerical calculations wrapped by 'data'. Units of keV.\n\n\n\n\n\n","category":"method"},{"location":"examples/plots/#Energy-Distributions-at-Generator-level","page":"Energy Distributions at Generator level","title":"Energy Distributions at Generator level","text":"","category":"section"},{"location":"examples/plots/","page":"Energy Distributions at Generator level","title":"Energy Distributions at Generator level","text":"In this example, we will generate 1 million events for 2nu and 0nu decays of ^76textrmGe and plot summed electron energy spectra as sanity checks.","category":"page"},{"location":"examples/plots/","page":"Energy Distributions at Generator level","title":"Energy Distributions at Generator level","text":"using DoubleBetaDecayGenerators\nusing FHist\nusing CairoMakie\n\ndat_0nu = ZeroNuDBDData(:Ge76)\ndat_2nu = TwoNuDBDData(:Ge76);","category":"page"},{"location":"examples/plots/","page":"Energy Distributions at Generator level","title":"Energy Distributions at Generator level","text":"Note that the data files needed for the generators are handled automatically via Artifacts API.","category":"page"},{"location":"examples/plots/","page":"Energy Distributions at Generator level","title":"Energy Distributions at Generator level","text":"energies_0nu = [\n    let (E1, E2, cosθ12) = rand(dat_0nu)\n            E1 + E2\n    end for i in 1:1_000_000\n]\nenergies_2nu = [\n    let (E1, E2, cosθ12) = rand(dat_2nu)\n            E1 + E2\n    end for i in 1:1_000_000\n]\n\nstephist(\n    Hist1D(energies_0nu, binedges = 0:2040),\n    axis = (;\n        yscale = log10, limits = (nothing, (0.5, 10^7)),\n        xlabel = L\"$E_1$ + $E_2$ [keV]\", ylabel = \"Counts/(1 keV)\",\n        title = L\"0\\nu\\beta\\beta\\;(N=10^6)\",\n    )\n)","category":"page"},{"location":"examples/plots/","page":"Energy Distributions at Generator level","title":"Energy Distributions at Generator level","text":"<img width=600 height=450 style='object-fit: contain; height: auto;' src=\"data:image/png;base64, \"/>","category":"page"},{"location":"examples/plots/","page":"Energy Distributions at Generator level","title":"Energy Distributions at Generator level","text":"As we expected, the 0nubetabeta spectrum is a peak at the Q-value (2039 keV for ^76rmGe), while the 2nubetabeta spectrum is a broad continuum from 0 to the Q-value.","category":"page"},{"location":"examples/plots/","page":"Energy Distributions at Generator level","title":"Energy Distributions at Generator level","text":"stephist(\n    Hist1D(energies_2nu, binedges = 0:2040),\n    axis = (;\n        yscale = log10, limits = (nothing, (0.5, 10^4)),\n        xlabel = L\"$E_1$ + $E_2$ [keV]\", ylabel = \"Counts/(1 keV)\",\n        title = L\"2\\nu\\beta\\beta\\;(N=10^6)\"\n    )\n)","category":"page"},{"location":"examples/plots/","page":"Energy Distributions at Generator level","title":"Energy Distributions at Generator level","text":"<img width=600 height=450 style='object-fit: contain; height: auto;' src=\"data:image/png;base64, \"/>","category":"page"},{"location":"examples/plots/","page":"Energy Distributions at Generator level","title":"Energy Distributions at Generator level","text":"","category":"page"},{"location":"examples/plots/","page":"Energy Distributions at Generator level","title":"Energy Distributions at Generator level","text":"This page was generated using Literate.jl.","category":"page"},{"location":"#DoubleBetaDecayGenerators.jl","page":"Home","title":"DoubleBetaDecayGenerators.jl","text":"","category":"section"}]
